CREATE DEFINER=`root`@`localhost` PROCEDURE `GetJobs_Pager` (IN `_PageIndex` INT, IN `_PageSize` INT, IN `_SortExpression` VARCHAR(50), IN `_SortDirection` VARCHAR(50), OUT `_RecordCount` INT)  BEGIN
       SET @RowNumber:=0;
  
       CREATE TEMPORARY TABLE Results
       SELECT @RowNumber:=@RowNumber+1 RowNumber
              ,JobId
              ,JobCode
              ,CreatedOn
       FROM Jobs
       ORDER BY
        CASE WHEN _SortExpression = 'JobId' AND _SortDirection='ASC' THEN JobId END ASC,
        CASE WHEN _SortExpression = 'JobId' AND _SortDirection='DESC' THEN JobId END DESC,
        CASE WHEN _SortExpression = 'JobCode' AND _SortDirection='ASC' THEN JobCode END ASC,
        CASE WHEN _SortExpression = 'JobCode' AND _SortDirection='DESC' THEN JobCode END DESC,
        CASE WHEN _SortExpression = 'ClientId' AND _SortDirection='ASC' THEN ClientId END ASC,
        CASE WHEN _SortExpression = 'ClientId' AND _SortDirection='DESC' THEN ClientId END DESC
        ;
  
       SET _RecordCount =(SELECT COUNT(*) FROM Results);
  
       SELECT * FROM Results
       WHERE RowNumber BETWEEN(_PageIndex -1) * _PageSize + 1 AND(((_PageIndex -1) * _PageSize + 1) + _PageSize) - 1;
  
       DROP TEMPORARY TABLE Results;
END$$

