CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_CalculateJobHours` ()  MODIFIES SQL DATA
BEGIN
DECLARE currentDate datetime;
declare dayStatus varchar(10);
declare Job_Processed boolean default false;    
declare jobId int(11) default 0;
declare jobStartDateTime datetime;
declare userId int(11) default 0;
Declare userLoginTime  datetime;
Declare userLogoutTime datetime;
Declare userLoggedInToday boolean DEFAULT false;
Declare userHoursSpentOnJob decimal(11,2) default 0.00;
Declare firstHalfStartTimeVar  time;
declare firstHalfEndTimeVar  time;
Declare secondHalfStartTimeVar time;
declare secondHalfEndTimeVar  time;

Declare officeHours decimal(11,2) default 0.00;
declare overTimeHours  decimal(11,2) default 0.00;
declare startDayOffsetHours decimal(11,2) default 0.00;

Declare userAWRStartTime  datetime;
Declare userAWREndTime datetime;
Declare userAWRToday boolean DEFAULT false;


declare jobActivityId int(11) default 0;

  DECLARE curJobs CURSOR FOR select J.JobId, JA.jobActivityId, JA.AssignTo,JA.ActionTime from Jobs J 
inner join jobActivities JA on J.JobId = JA.JobId 
inner join GlobalCodes GCActivity on JA.Action = GCActivity.GlobalCodeId 
inner join GlobalCodes GCStatus on J.Status = GCStatus.GlobalCodeId 
where GCStatus.CodeName = 'In Progress' and JA.JobAccepted = 1 and timestampdiff(DAY,JA.ActionTime,CURRENT_DATE)>0;
 DECLARE CONTINUE HANDLER FOR NOT FOUND SET Job_Processed = true;
set  currentDate = CURRENT_DATE;



select Time(FirstHalfStartTime), Time(FirstHalfEndTime), Time(SecondHalfStartTime), Time(SecondHalfEndTime)  into firstHalfStartTimeVar, firstHalfEndTimeVar, secondHalfStartTimeVar , secondHalfEndTimeVar from BusinessHours;
 


 if lower(dayname(currentdate))='friday' then
set dayStatus = 'Off';
elseif exists(Select OccasionDate from Holidays where OccasionDate = currentdate)  then
set dayStatus = 'Holiday';
else
set dayStatus = 'Working';
END if;

 OPEN curJobs ;
    cur_Jobs_loop: LOOP
    FETCH FROM curJobs INTO jobId, jobActivityId, userId, jobStartDateTime;

        IF Job_Processed THEN
        CLOSE curJobs ;
        LEAVE cur_Jobs_loop;
        END IF;

        BLOCK2: BEGIN

if daystatus = 'Working' THEN

set officeHours= ((timestampdiff(MINUTE,firstHalfStartTimeVar,firstHalfEndTimeVar) + timestampdiff(MINUTE,secondHalfStartTimeVar,secondHalfEndTimeVar))/60) ;
end IF;

if exists(select WorkRequestId from `AdditionalWorkRequest`  AWR inner join `GlobalCodes` GC on AWR.RequestStatus = GC.GlobalCodeId where GC.CodeName = 'Accepted' and RequestDate=currentdate and AWR.UserId = userId and AWR.JobId = jobId and AWR.IsDeleted = 0
) THEN

if dayStatus = 'Working' THEN
	if exists (select AWR.WorkRequestId from AdditionalWorkRequest AWR 
   inner join `GlobalCodes` GC on AWR.RequestStatus = GC.GlobalCodeId where GC.CodeName = 'Accepted' and RequestDate=currentdate and AWR.UserId = userId and AWR.JobId = jobId and AWR.IsDeleted = 0
and AWR.StartTime between firstHalfStartTime and secondHalfEndTime
and AWR.EndTime> secondHalfEndTime) THEN
    
    select cast(timestampdiff(MINUTE,secondHalfEndTime,EndTime)/60 as decimal(11,2)) into overTimeHours from `AdditionalWorkRequest`  AWR inner join `GlobalCodes` GC on AWR.RequestStatus = GC.GlobalCodeId where GC.CodeName = 'Accepted' and RequestDate=currentdate and AWR.UserId = userId and AWR.JobId = jobId and AWR.IsDeleted = 0;
    
    ELSE

select cast(timestampdiff(MINUTE,StartTime,EndTime)/60 as decimal(11,2)) into overTimeHours from `AdditionalWorkRequest`  AWR inner join `GlobalCodes` GC on AWR.RequestStatus = GC.GlobalCodeId where GC.CodeName = 'Accepted' and RequestDate=currentdate and AWR.UserId = userId and AWR.JobId = jobId and AWR.IsDeleted = 0;


    end if ;
ELSE
select cast(timestampdiff(MINUTE,StartTime,EndTime)/60 as decimal(11,2)) into overTimeHours from `AdditionalWorkRequest`  AWR inner join `GlobalCodes` GC on AWR.RequestStatus = GC.GlobalCodeId where GC.CodeName = 'Accepted' and RequestDate=currentdate and AWR.UserId = userId and AWR.JobId = jobId and AWR.IsDeleted = 0;

end if;
end if;



if timestampdiff(DAY,jobStartDateTime,CURRENT_DATE)>0 THEN
 if exists(SELECT BusinessHourId from BusinessHours 
           where Time(jobStartDateTime) between Time(FirstHalfStartTime) and Time(FirstHalfEndTime)) THEN
           select (timestampdiff(MINUTE,Time(FirstHalfStartTime) ,Time(jobStartDateTime)))/60 INTO startDayOffsetHours from BusinessHours;
           elseif exists (SELECT BusinessHourId from BusinessHours 
           where Time(jobStartDateTime) between Time(SecondHalfStartTime) and Time(SecondHalfEndTime)) THEN
           select (timestampdiff(MINUTE, FirstHalfStartTime, FirstHalfEndTime) +   timestampdiff(MINUTE,Time(SecondHalfStartTime) ,Time(jobStartDateTime)))/60 INTO startDayOffsetHours from BusinessHours;
           
           End if;
          end if; 
          
           set userHoursSpentOnJob = IFNULL(officeHours, 0.00) + IFNULL(overTimeHours,0.00) - IFNULL(startDayOffsetHours,0.00);



	values (jobActivityId,1,0, userid,currentDate,userHoursSpentOnJob,CURRENT_DATE,'System');


set officeHours =0.00;
set overTimeHours = 0.00;
set userHoursSpentOnJob = 0.00 ;
        END BLOCK2;
    END LOOP cur_Jobs_loop;

END$$

