CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_checkRequestTime` (IN `RequestuserId` INT)  BEGIN

select WorkRequestId from AdditionalWorkRequest as awr join GlobalCodes gc on awr.RequestStatus = gc.GlobalCodeId
where DATE(awr.RequestDate) = DATE(Now()) AND awr.jobid = RequestuserId  AND LOWER(gc.CodeName) = 'accepted'
and DATE_ADD(NOW(), INTERVAL 90 MINUTE) BETWEEN awr.StartTime and awr.EndTime LIMIT 1;

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_CloneRecord` (IN `tablename` VARCHAR(100), IN `id` INT, IN `createdby` VARCHAR(50), IN `templatecode` VARCHAR(100))  BEGIN
		DECLARE result bit DEFAULT 0;
		CASE WHEN
			tablename = 'Templates' THEN
			
				SELECT IsActive, createdby, NOW(), 0, Machine, MachineType,Segment,SegmentType,TemplateType,templatecode,TemplateName,Description FROM Templates WHERE TemplateId=id;			
			
