	END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_CreateDecisionTree` ()  NO SQL
BEGIN
Declare RootQuestionsCount int;
Declare QuestionsCounter int;
Declare CurrentQuestionId int;
Declare CurrentQuestionOptionId int;
Declare CurrentTreeNodeId int;


Set RootQuestionsCount = 0;
set QuestionsCounter = 1;
Set CurrentTreeNodeId = 1;


CREATE TEMPORARY TABLE DecisionTree(
	TreeNodeId int PRIMARY KEY auto_Increment,		
    TempQuestionId INT,
    TempQuestionOptionId int,
    TempNextQuestionId int,
    ParentTreeNodeId int
);

CREATE TEMPORARY TABLE RootQuestions(
	RootQuestionIndex int PRIMARY KEY auto_Increment,		
    TempQuestionId INT
);

SELECT QuestionId FROM `Questions` WHERE isroot=1 order by stage;

select count(*) into RootQuestionsCount from RootQuestions;

while QuestionsCounter<=RootQuestionsCount do
Select TempQuestionId into CurrentQuestionId from RootQuestions where RootQuestionIndex = QuestionsCounter;

Select CurrentQuestionId, NextQuestion from Questions where QuestionId = CurrentQuestionId;

Select Max(TreeNodeId) into CurrentTreeNodeId from DecisionTree;

call sp_CreateQuestionsOptions (CurrentQuestionId, CurrentTreeNodeId);
set QuestionsCounter = QuestionsCounter + 1;

end while;
select DT.TreeNodeId,Q.QuestionId,Q.isRoot,Q.Stage,Q.Question,QO.OptionText, DT.ParentTreeNodeId from DecisionTree DT inner join Questions Q on DT.TempQuestionId = Q.QuestionId left join QuestionsOptions QO on DT.TempQuestionOptionId = QO.QuestionOptionId order by Q.Stage,Q.IsRoot desc,DT.ParentTreeNodeId;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_CreateQuestionsOptions` (IN `ParamQuestionId` INT, IN `ParamParentTreeNodeId` INT)  NO SQL
BEGIN


Declare CurrentQuestionOptionId int;
Declare CurrentTreeNodeId int;
Declare QuestionOptionsCounter int;
Declare CurrentNextQuestionId INT;
Declare QuestionOptionsCount int;
Declare TempQuestionNextQuestion int;
SET max_sp_recursion_depth=20;
Set CurrentQuestionOptionId =0;
Set CurrentTreeNodeId = 0;
Set CurrentNextQuestionId = 0 ;
Set QuestionOptionsCounter = 1;
Set QuestionOptionsCount = 0;
set TempQuestionNextQuestion=0;



CREATE TEMPORARY TABLE iF NOT EXISTS TempQuestionsOptions (
	QuestionOptionIndex int PRIMARY KEY auto_Increment,		
    TempQuestionId INT,
    TempQuestionOptionId int,
    TempNextQuestionId int,
    ParentTreeNodeId int
);

Select Max(TreeNodeId) into CurrentTreeNodeId from DecisionTree;
if CurrentTreeNodeId<20000 THEN


if ParamParentTreeNodeId is null THEN
set ParamParentTreeNodeId = 0;
end if;
Select NextQuestion into TempQuestionNextQuestion from Questions where QuestionId = ParamQuestionId ;

if TempQuestionNextQuestion>0 THEN


Select QuestionId,CurrentTreeNodeId, NextQuestion from Questions where QuestionId = TempQuestionNextQuestion;


Select Max(TreeNodeId) into CurrentTreeNodeId from DecisionTree;


call sp_CreateQuestionsOptions (TempQuestionNextQuestion, CurrentTreeNodeId);


else

select QuestionId, QuestionOptionId, NextQuestion,ParamParentTreeNodeId from 
QuestionsOptions where QuestionId = ParamQuestionId;

Select min(QuestionOptionIndex),max(QuestionOptionIndex) into QuestionOptionsCounter,QuestionOptionsCount from TempQuestionsOptions where ParentTreeNodeId = ParamParentTreeNodeId;


while QuestionOptionsCounter<=QuestionOptionsCount do
Select TempQuestionOptionId,TempNextQuestionId into CurrentQuestionOptionId,CurrentNextQuestionId from TempQuestionsOptions where QuestionOptionIndex = QuestionOptionsCounter;

select QuestionId, QuestionOptionId, ParamParentTreeNodeId,CurrentNextQuestionId from QuestionsOptions where QuestionOptionId = CurrentQuestionOptionId;

Select Max(TreeNodeId) into CurrentTreeNodeId from DecisionTree;

if CurrentNextQuestionId > 0 then


Select QuestionId,CurrentTreeNodeId, NextQuestion from Questions where QuestionId = CurrentNextQuestionId;


Select Max(TreeNodeId) into CurrentTreeNodeId from DecisionTree;

call sp_CreateQuestionsOptions (CurrentNextQuestionId, CurrentTreeNodeId);

end if;
set QuestionOptionsCounter = QuestionOptionsCounter + 1;

end while;

end if;

end if;

End$$

