			Roles
		SET
			IsDeleted = 1,
			DeletedBy = deletedby,
			DeletedOn = NOW()
		WHERE
			RoleId = id;
			WHEN
			tablename = 'Users' THEN
		UPDATE
			Users
		SET
			IsDeleted = 1,
			DeletedBy = deletedby,
			DeletedOn = NOW()
		WHERE
			UserId = id;
			WHEN
			tablename = 'Client' THEN
		UPDATE
			Client
		SET
			IsDeleted = 1,
			DeletedBy = deletedby,
			DeletedOn = NOW()
		WHERE
			ClientId = id;
			WHEN
			tablename = 'ObjectAttributes' THEN
		UPDATE
			ObjectAttributes
		SET
			IsDeleted = 1,
			DeletedBy = deletedby,
			DeletedOn = NOW()
		WHERE
			ObjectAttributeId = id;
			
		UPDATE
			Attributes
		SET
			IsDeleted = 1,
			DeletedBy = deletedby,
			DeletedOn = NOW()
		WHERE
			AttributeId = (SELECT AttributeId FROM ObjectAttributes WHERE ObjectAttributeId = id);
			WHEN
			tablename = 'Templates' THEN
		UPDATE
			Templates
		SET
			IsDeleted = 1,
			DeletedBy = deletedby,
			DeletedOn = NOW()
		WHERE
			TemplateId = id;
		WHEN
			tablename = 'attributescollections' THEN
		UPDATE
			AttributesCollections
		SET
			IsDeleted = 1,
			DeletedBy = deletedby,
			DeletedOn = NOW()
		WHERE
			AttributeCollectionId = id;

			WHEN
			tablename = 'Inventorys' THEN
		UPDATE
			Inventorys
		SET
			IsDeleted = 1,
			DeletedBy = deletedby,
			DeletedOn = NOW()
		WHERE
			StockId = id;
			WHEN
			tablename = 'Permissions' THEN
		UPDATE
			Permissions
		SET
			IsDeleted = 1,
			DeletedBy = deletedby,
			DeletedOn = NOW()
		WHERE
			RolePermissionId = id;
			END CASE;
			
			IF (Select ROW_COUNT() > 0)
			THEN
			   set result = 1;
			END IF;
	   Select result as result;
	END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_DeleteWidget` (IN `widgetcode` VARCHAR(100), IN `userid` INT, IN `updatedby` VARCHAR(50))  BEGIN
		DECLARE result bit DEFAULT 0;
		DECLARE userwidgetId int;

		set userwidgetId=(Select UserWidgetMappingId from UserWidgetMappings uwm
		Inner Join Widgets w on w.WidgetId=uwm.WidgetId
		Where w.WidgetCode=widgetcode and uwm.Userid=userid);
    UPDATE
        UserWidgetMappings
    SET
        IsDeleted = 1,
        ModifiedBy = updatedby,
        ModifiedOn = NOW()
    WHERE
        UserWidgetMappingId = userwidgetId;	
		
			IF (Select ROW_COUNT() > 0)
			THEN
			   set result = 1;
			END IF;
	   Select result as result;
	END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetGlobalCodePermission` (IN `id` INT, IN `deletedby` VARCHAR(50))  BEGIN
		
