CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetJobs` (IN `StageId` INT(11) ZEROFILL, IN `JobType` INT(11) ZEROFILL, IN `MachineType` INT(11) ZEROFILL, IN `AssignTo` INT(11) ZEROFILL, IN `StartDate` DATE, IN `EndDate` DATE, IN `ClientId` INT(11) ZEROFILL, IN `OrderByDescending` VARCHAR(20), IN `OrderBy` VARCHAR(50), IN `JobStatus` VARCHAR(50), IN `AllRecord` BOOLEAN, IN `PageSize` INT(11), IN `PageIndex` INT(11))  BEGIN
		
SET @RowCount:=0;
  
CREATE TEMPORARY TABLE Results
SELECT  @RowCount:=@RowCount+1 RowCount, `J1`.`JobId`, `J1`.`Paid`, `J1`.`JobCode`,`J1`.`EquipmentId`, `J1`.`MachineId`, `M1`.`MachineName`, `MT1`.`MachineTypeId`, 
`MT1`.`MachineType` AS `MachineTypeName`, `S1`.`SegmentId` AS `SegmentId`,`S1`.`Segment` AS `SegmentName`,`J1`.`SubSegmentId` AS `SubSegmentId`,`S2`.`Segment` AS `SubSegmentName`,  `J1`.`JobTypeId`, `JT1`.`JobType` AS `JobTypeName`, `ST1`.`Stages` AS `Stage`, `ST1`.`StageId`, `ST1`.`Order`, 
`U1`.`FirstName`, `U1`.`LastName`, `J1`.`ClientId`, `C1`.`Name` AS `ClientName`, `C1`.`IsActive`, `J1`.`CreatedOn`, `GC1`.`CodeName` AS `JobStatus`,  
CONCAT(`U1`.`FirstName`, ' ', `U1`.`LastName`) AS `Staff`,
(Select GROUP_CONCAT(CONCAT(`U2`.`FirstName`, ' ', `U2`.`LastName`)) from `Users` as `U2` 
INNER join `jobActivities` as `joba` where `U2`.`UserId` = `joba`.`AssignTo` AND `joba`.`JobId`=`J1`.`JobId`) as `AssignTo`, IFNULL((
          SELECT SUM(`x1`.`Hours`)
          FROM `jobActivities` AS `x1` 
          WHERE `x1`.`JobId` = `J1`.`JobId` 
      ),0) AS `Hours`
      FROM `Jobs` AS `J1`
      INNER JOIN `Machines` AS `M1` ON `J1`.`MachineId` = `M1`.`MachineId`
      INNER JOIN `MachineTypes` AS `MT1` ON `J1`.`MachineTypeId` = `MT1`.`MachineTypeId`
	  LEFT JOIN `Segments` AS `S1` ON `J1`.`SegmentId` = `S1`.`SegmentId`
       LEFT JOIN `Segments` AS `S2` ON `J1`.`SubSegmentId` = `S2`.`SegmentId`
      INNER JOIN `Client` AS `C1` ON `J1`.`ClientId` = `C1`.`ClientId`
      INNER JOIN `JobTypes` AS `JT1` ON `J1`.`JobTypeId` = `JT1`.`JobTypeId`
      INNER JOIN `Users` AS `U1` ON `J1`.`UserId` = `U1`.`UserId`
      INNER JOIN `Stages` AS `ST1` ON `J1`.`StageId` = `ST1`.`StageId`
      INNER JOIN `GlobalCodes` AS `GC1` ON `J1`.`Status` = `GC1`.`GlobalCodeId`
      
      where 
      (StageId =0 or `J1`.`StageId` = StageId)
      and (JobType =0 or `J1`.`JobTypeId` = JobType)
      and (MachineType =0 or `J1`.`MachineTypeId` = MachineType)
      and (AssignTo =0 or EXISTS(select `JobActivityId` from `jobActivities` as `JA` inner join GlobalCodes GC12 on `JA`.Action = GC12.GlobalCodeId 
	  where `JA`.`AssignTo` = AssignTo and AssignTo!=0 and `J1`.`JobId` = `JA`.`JobId` and 
      ((`JA`.`JobAccepted` = true and JobStatus ='In Progress')
      OR
       JobStatus !='In Progress'
      )
      
      ) )
      and (ClientId =0 or `J1`.`ClientId` = ClientId)
      and ((StartDate is null) or `J1`.`CreatedOn`>=StartDate)
      and ((EndDate is null) or `J1`.`CreatedOn`<=EndDate)
      and ((JobStatus is null or JobStatus = '') or GC1.CodeName = JobStatus)
		-- order by OrderBy + (CASE WHEN OrderByDescending THEN 'DESC' ELSE 'ASC' END);
		ORDER BY
		CASE WHEN OrderBy = 'Paid' AND OrderByDescending='ASC' THEN Paid END ASC,
        CASE WHEN OrderBy = 'Paid' AND OrderByDescending='DESC' THEN Paid END DESC,
        CASE WHEN OrderBy = 'JobId' AND OrderByDescending='ASC' THEN JobId END ASC,
        CASE WHEN OrderBy = 'JobId' AND OrderByDescending='DESC' THEN JobId END DESC,
        CASE WHEN OrderBy = 'JobCode' AND OrderByDescending='ASC' THEN JobCode END ASC,
        CASE WHEN OrderBy = 'JobCode' AND OrderByDescending='DESC' THEN JobCode END DESC,
		CASE WHEN OrderBy = 'JobTypeId' AND OrderByDescending='ASC' THEN `J1`.`JobTypeId` END ASC,
        CASE WHEN OrderBy = 'JobTypeId' AND OrderByDescending='DESC' THEN `J1`.`JobTypeId` END DESC,
		CASE WHEN OrderBy = 'JobTypeName' AND OrderByDescending='ASC' THEN JobTypeName END ASC,
        CASE WHEN OrderBy = 'JobTypeName' AND OrderByDescending='DESC' THEN JobTypeName END DESC,
		CASE WHEN OrderBy = 'MachineId' AND OrderByDescending='ASC' THEN `J1`.`MachineId` END ASC,
        CASE WHEN OrderBy = 'MachineId' AND OrderByDescending='DESC' THEN `J1`.`MachineId` END DESC,
		CASE WHEN OrderBy = 'MachineName' AND OrderByDescending='ASC' THEN MachineName END ASC,
        CASE WHEN OrderBy = 'MachineName' AND OrderByDescending='DESC' THEN MachineName END DESC,
		CASE WHEN OrderBy = 'MachineTypeId' AND OrderByDescending='ASC' THEN `J1`.`MachineTypeId` END ASC,
        CASE WHEN OrderBy = 'MachineTypeId' AND OrderByDescending='DESC' THEN `J1`.`MachineTypeId` END DESC,
		CASE WHEN OrderBy = 'MachineTypeName' AND OrderByDescending='ASC' THEN MachineTypeName END ASC,
        CASE WHEN OrderBy = 'MachineTypeName' AND OrderByDescending='DESC' THEN MachineTypeName END DESC,
		          
		CASE WHEN OrderBy = 'Stage' AND OrderByDescending='ASC' THEN Stage END ASC,
        CASE WHEN OrderBy = 'Stage' AND OrderByDescending='DESC' THEN Stage END DESC,
		CASE WHEN OrderBy = 'StageId' AND OrderByDescending='ASC' THEN StageId END ASC,
        CASE WHEN OrderBy = 'StageId' AND OrderByDescending='DESC' THEN StageId END DESC,
		CASE WHEN OrderBy = 'FirstName' AND OrderByDescending='ASC' THEN FirstName END ASC,
        CASE WHEN OrderBy = 'FirstName' AND OrderByDescending='DESC' THEN FirstName END DESC,
		CASE WHEN OrderBy = 'LastName' AND OrderByDescending='ASC' THEN LastName END ASC,
        CASE WHEN OrderBy = 'LastName' AND OrderByDescending='DESC' THEN LastName END DESC,
		          
        CASE WHEN OrderBy = 'ClientId' AND OrderByDescending='ASC' THEN ClientId END ASC,
        CASE WHEN OrderBy = 'ClientId' AND OrderByDescending='DESC' THEN ClientId END DESC,
		CASE WHEN OrderBy = 'ClientName' AND OrderByDescending='ASC' THEN ClientName END ASC,
        CASE WHEN OrderBy = 'ClientName' AND OrderByDescending='DESC' THEN ClientName END DESC,
		CASE WHEN OrderBy = 'IsActive' AND OrderByDescending='ASC' THEN `J1`.`IsActive` END ASC,
        CASE WHEN OrderBy = 'IsActive' AND OrderByDescending='DESC' THEN `J1`.`IsActive` END DESC,
		
		CASE WHEN OrderBy = 'CreatedOn' AND OrderByDescending='ASC' THEN `J1`.`CreatedOn` END ASC,
        CASE WHEN OrderBy = 'CreatedOn' AND OrderByDescending='DESC' THEN `J1`.`CreatedOn` END DESC,
		
		CASE WHEN OrderBy = 'JobStatus' AND OrderByDescending='ASC' THEN JobStatus END ASC,
        CASE WHEN OrderBy = 'JobStatus' AND OrderByDescending='DESC' THEN JobStatus END DESC,
		CASE WHEN OrderBy = 'AssignTo' AND OrderByDescending='ASC' THEN AssignTo END ASC,
        CASE WHEN OrderBy = 'AssignTo' AND OrderByDescending='DESC' THEN AssignTo END DESC,
		CASE WHEN OrderBy = 'Staff' AND OrderByDescending='ASC' THEN Staff END ASC,
        CASE WHEN OrderBy = 'Staff' AND OrderByDescending='DESC' THEN Staff END DESC,
		CASE WHEN OrderBy = 'Hours' AND OrderByDescending='ASC' THEN Hours END ASC,
        CASE WHEN OrderBy = 'Hours' AND OrderByDescending='DESC' THEN Hours END DESC
		;
        
       if AllRecord = TRUE then
			SELECT * FROM Results;
		else 
			SELECT * FROM Results LIMIT PageIndex, PageSize;
		end if;
        
       DROP TEMPORARY TABLE Results;
			END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetJobs1` (IN `StageId` INT(11) ZEROFILL, IN `JobType` INT(11) ZEROFILL, IN `MachineType` INT(11) ZEROFILL, IN `AssignTo` INT(11) ZEROFILL, IN `StartDate` DATE, IN `EndDate` DATE, IN `ClientId` INT(11) ZEROFILL, IN `OrderByDescending` BOOLEAN, IN `OrderBy` VARCHAR(50), IN `JobStatus` VARCHAR(50), IN `AllRecord` BOOLEAN, IN `PageSize` INT(11), IN `PageIndex` INT(11), IN `row_number` INT(11) ZEROFILL, OUT `_RecordCount` INT)  BEGIN
		
SET @RowCount:=0;
  
CREATE TEMPORARY TABLE Results
SELECT  @RowCount:=@RowCount+1 RowCount, `J1`.`JobId`, `J1`.`JobCode`, `J1`.`MachineId`, `M1`.`MachineName`, `MT1`.`MachineTypeId`, 
`MT1`.`MachineType` AS `MachineTypeName`, `J1`.`JobTypeId`, `JT1`.`JobType` AS `JobTypeName`, `ST1`.`Stages` AS `Stage`, `ST1`.`StageId`, `ST1`.`Order`, 
`U1`.`FirstName`, `U1`.`LastName`, `J1`.`ClientId`, `C1`.`Name` AS `ClientName`, `C1`.`IsActive`, `J1`.`CreatedOn`, `GC1`.`CodeName` AS `JobStatus`,  
CONCAT(`U1`.`FirstName`, ' ', `U1`.`LastName`) AS `Staff`,
(Select GROUP_CONCAT(CONCAT(`U2`.`FirstName`, ' ', `U2`.`LastName`)) from `Users` as `U2` 
INNER join `jobActivities` as `joba` where `U2`.`UserId` = `joba`.`AssignTo` AND `joba`.`JobId`=`J1`.`JobId`) as `AssignTo`, (
          SELECT SUM(`x1`.`Hours`)
          FROM `jobActivities` AS `x1` 
          WHERE `x1`.`JobId` = `J1`.`JobId` 
      ) AS `Hours`
      FROM `Jobs` AS `J1`
      INNER JOIN `Machines` AS `M1` ON `J1`.`MachineId` = `M1`.`MachineId`
      INNER JOIN `MachineTypes` AS `MT1` ON `J1`.`MachineTypeId` = `MT1`.`MachineTypeId`
      INNER JOIN `Client` AS `C1` ON `J1`.`ClientId` = `C1`.`ClientId`
      INNER JOIN `JobTypes` AS `JT1` ON `J1`.`JobTypeId` = `JT1`.`JobTypeId`
      INNER JOIN `Users` AS `U1` ON `J1`.`UserId` = `U1`.`UserId`
      INNER JOIN `Stages` AS `ST1` ON `J1`.`StageId` = `ST1`.`StageId`
      INNER JOIN `GlobalCodes` AS `GC1` ON `J1`.`Status` = `GC1`.`GlobalCodeId`
      
      where 
      (StageId =0 or `J1`.`StageId` = StageId)
      and (JobType =0 or `J1`.`JobTypeId` = JobType)
      and (MachineType =0 or `J1`.`MachineTypeId` = MachineType)
      and (AssignTo =0 or EXISTS(select `JobActivityId` from `jobActivities` as `JA` inner join GlobalCodes GC12 on `JA`.Action = GC12.GlobalCodeId 
	  where `JA`.`AssignTo` = AssignTo and AssignTo!=0 and `J1`.`JobId` = `JA`.`JobId` and 
      ((GC12.CodeName !='Job Completed' and JobStatus ='In Progress')
      OR
       JobStatus !='In Progress'
      )
      
      ) )
      and (ClientId =0 or `J1`.`ClientId` = ClientId)
      and ((StartDate is null) or `J1`.`CreatedOn`>=StartDate)
      and ((EndDate is null) or `J1`.`CreatedOn`<=EndDate)
      and ((JobStatus is null or JobStatus = '') or GC1.CodeName = JobStatus)
		-- order by OrderBy + (CASE WHEN OrderByDescending THEN 'DESC' ELSE 'ASC' END);
		ORDER BY
        CASE WHEN OrderBy = 'JobId' AND OrderBy='ASC' THEN JobId END ASC,
        CASE WHEN OrderBy = 'JobId' AND OrderBy='DESC' THEN JobId END DESC,
        CASE WHEN OrderBy = 'JobCode' AND OrderBy='ASC' THEN JobCode END ASC,
        CASE WHEN OrderBy = 'JobCode' AND OrderBy='DESC' THEN JobCode END DESC,
		CASE WHEN OrderBy = 'JobTypeId' AND OrderBy='ASC' THEN `J1`.`JobTypeId` END ASC,
        CASE WHEN OrderBy = 'JobTypeId' AND OrderBy='DESC' THEN `J1`.`JobTypeId` END DESC,
		CASE WHEN OrderBy = 'JobTypeName' AND OrderBy='ASC' THEN JobTypeName END ASC,
        CASE WHEN OrderBy = 'JobTypeName' AND OrderBy='DESC' THEN JobTypeName END DESC,
		CASE WHEN OrderBy = 'MachineId' AND OrderBy='ASC' THEN `J1`.`MachineId` END ASC,
        CASE WHEN OrderBy = 'MachineId' AND OrderBy='DESC' THEN `J1`.`MachineId` END DESC,
		CASE WHEN OrderBy = 'MachineName' AND OrderBy='ASC' THEN MachineName END ASC,
        CASE WHEN OrderBy = 'MachineName' AND OrderBy='DESC' THEN MachineName END DESC,
		CASE WHEN OrderBy = 'MachineTypeId' AND OrderBy='ASC' THEN `J1`.`MachineTypeId` END ASC,
        CASE WHEN OrderBy = 'MachineTypeId' AND OrderBy='DESC' THEN `J1`.`MachineTypeId` END DESC,
		CASE WHEN OrderBy = 'MachineTypeName' AND OrderBy='ASC' THEN MachineTypeName END ASC,
        CASE WHEN OrderBy = 'MachineTypeName' AND OrderBy='DESC' THEN MachineTypeName END DESC,
		          
		CASE WHEN OrderBy = 'Stage' AND OrderBy='ASC' THEN Stage END ASC,
        CASE WHEN OrderBy = 'Stage' AND OrderBy='DESC' THEN Stage END DESC,
		CASE WHEN OrderBy = 'StageId' AND OrderBy='ASC' THEN StageId END ASC,
        CASE WHEN OrderBy = 'StageId' AND OrderBy='DESC' THEN StageId END DESC,
		CASE WHEN OrderBy = 'FirstName' AND OrderBy='ASC' THEN FirstName END ASC,
        CASE WHEN OrderBy = 'FirstName' AND OrderBy='DESC' THEN FirstName END DESC,
		CASE WHEN OrderBy = 'LastName' AND OrderBy='ASC' THEN LastName END ASC,
        CASE WHEN OrderBy = 'LastName' AND OrderBy='DESC' THEN LastName END DESC,
		          
        CASE WHEN OrderBy = 'ClientId' AND OrderBy='ASC' THEN ClientId END ASC,
        CASE WHEN OrderBy = 'ClientId' AND OrderBy='DESC' THEN ClientId END DESC,
		CASE WHEN OrderBy = 'ClientName' AND OrderBy='ASC' THEN ClientName END ASC,
        CASE WHEN OrderBy = 'ClientName' AND OrderBy='DESC' THEN ClientName END DESC,
		CASE WHEN OrderBy = 'IsActive' AND OrderBy='ASC' THEN `J1`.`IsActive` END ASC,
        CASE WHEN OrderBy = 'IsActive' AND OrderBy='DESC' THEN `J1`.`IsActive` END DESC,
		CASE WHEN OrderBy = 'CreatedOn' AND OrderBy='ASC' THEN `J1`.`CreatedOn` END ASC,
        CASE WHEN OrderBy = 'CreatedOn' AND OrderBy='DESC' THEN `J1`.`CreatedOn` END DESC,
		CASE WHEN OrderBy = 'JobStatus' AND OrderBy='ASC' THEN JobStatus END ASC,
        CASE WHEN OrderBy = 'JobStatus' AND OrderBy='DESC' THEN JobStatus END DESC,
		CASE WHEN OrderBy = 'AssignTo' AND OrderBy='ASC' THEN AssignTo END ASC,
        CASE WHEN OrderBy = 'AssignTo' AND OrderBy='DESC' THEN AssignTo END DESC,
		CASE WHEN OrderBy = 'Staff' AND OrderBy='ASC' THEN Staff END ASC,
        CASE WHEN OrderBy = 'Staff' AND OrderBy='DESC' THEN Staff END DESC,
		CASE WHEN OrderBy = 'Hours' AND OrderBy='ASC' THEN Hours END ASC,
        CASE WHEN OrderBy = 'Hours' AND OrderBy='DESC' THEN Hours END DESC
		;
		SET _RecordCount =(SELECT COUNT(*) FROM Results);
  
       SELECT * FROM Results
       WHERE RowCount BETWEEN(PageIndex -1) * PageSize + 1 AND(((PageIndex -1) * PageSize + 1) + PageSize) - 1;
  
       DROP TEMPORARY TABLE Results;
			END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetJobsCount` (IN `StageId` INT(11) ZEROFILL, IN `JobType` INT(11) ZEROFILL, IN `MachineType` INT(11) ZEROFILL, IN `AssignTo` INT(11) ZEROFILL, IN `StartDate` DATE, IN `EndDate` DATE, IN `ClientId` INT(11) ZEROFILL, IN `JobStatus` VARCHAR(50))  READS SQL DATA
