      INNER JOIN `Users` AS `U1` ON `J1`.`UserId` = `U1`.`UserId`
      INNER JOIN `Stages` AS `ST1` ON `J1`.`StageId` = `ST1`.`StageId`
      INNER JOIN `GlobalCodes` AS `GC1` ON `J1`.`Status` = `GC1`.`GlobalCodeId`
      
      where 
      (StageId =0 or `J1`.`StageId` = StageId)
      and (JobType =0 or `J1`.`JobTypeId` = JobType)
      and (MachineType =0 or `J1`.`MachineTypeId` = MachineType)
      and (AssignTo =0 or EXISTS(select `JobActivityId` from `jobActivities` as `JA` inner join GlobalCodes GC12 on `JA`.Action = GC12.GlobalCodeId 
	  where `JA`.`AssignTo` = AssignTo and AssignTo!=0 and `J1`.`JobId` = `JA`.`JobId` and 
      ((GC12.CodeName !='Job Completed' and JobStatus ='In Progress') OR JobStatus !='In Progress')))
      and (ClientId =0 or `J1`.`ClientId` = ClientId)
     -- and ((StartDate is null or StartDate ='') or `J1`.`CreatedOn`>=StartDate)
      -- and ((EndDate is null or EndDate = '') or `J1`.`CreatedOn`<=EndDate)
      and ((StartDate is null ) or `J1`.`CreatedOn`>=StartDate)
       and ((EndDate is null ) or `J1`.`CreatedOn`<=EndDate)
      and ((JobStatus is null or JobStatus = '') or GC1.CodeName = JobStatus)$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getNextQuestion` (IN `JobIdParam` INT(11), IN `QuestionDetailIdInParam` INT(11))  NO SQL
Begin
Declare TempQuestionDetailId int(11) default -1;
Declare TempQuestionId int(11) default -1; 
Declare TempNextQuestionId int(11) default -1;
Declare TempTemplateId int(11) default -1;
set TempQuestionDetailId = QuestionDetailIdInParam;

select TemplateId into TempTemplateId from QuestionsDetail where JobID = JobIdParam and QuestionDetailId = QuestionDetailIdInParam;

	WITH Recursive Parents AS (
  SELECT 1 AS lvl,QD.QuestionId,Q.Question,QD.OptionId, QD.QuestionDetailId, 0 AS 'relative_depth', Q.NextQuestion, QO.NextQuestion as QONextQuestion, Q.InputType, Q.QuestionType, QO.ControlType
  FROM Questions Q inner join QuestionsDetail QD on Q.QuestionId = QD.QuestionId 
  left join QuestionsOptions QO on QO.QuestionOptionId = QD.OptionId
where QD.QuestionDetailId = TempQuestionDetailId

  UNION ALL

  SELECT P.lvl+1 AS lvl,QD.QuestionId,Q.question, QD.OptionId, QD.QuestionDetailId, relative_depth - 1 as 'relative_depth', Q.NextQuestion, QO.NextQuestion as QONextQuestion,Q.InputType, Q.QuestionType, QO.ControlType 
  FROM Questions Q inner join QuestionsDetail QD on Q.QuestionId = QD.QuestionId 
  inner join QuestionsOptions QO on QO.QuestionOptionId = QD.OptionId
  inner join Parents P on  (QO.NextQuestion =P.QuestionId or Q.NextQuestion = P.QuestionId)  
  where Q.TemplateId = TempTemplateId

 UNION ALL

  SELECT P.lvl+1 AS lvl,  QD.QuestionId,Q.question, QD.OptionId, QD.QuestionDetailId, relative_depth - 1 as 'relative_depth', Q.NextQuestion, -1 as QONextQuestion,Q.InputType, Q.QuestionType, -1
  FROM Questions Q inner join QuestionsDetail QD on IFnull(Q.QuestionId,0) = ifnull(QD.QuestionId,0) 
  inner join Parents P on  ifnull(Q.NextQuestion,0) = ifnull(P.QuestionId,0)
  where ifnull(Q.TemplateId,0) = TempTemplateId  and not exists(Select QuestionOptionId from QuestionsOptions QO where ifnull(QO.QuestionId,0) = ifnull(P.QuestionId,0))
  and relative_Depth <> relative_depth - 1
   
)

(Select qo.NextQuestion 'QuestionId',qd.QuestionDetailId from Parents P
inner join QuestionsOptions qo on qo.QuestionId = P.QuestionID
inner join QuestionsDetail qd on qd.optionid = qo.questionoptionid
where not exists(Select qd1.QuestionDetailId from QuestionsDetail qd1
where qd1.ParentDetailId = qd.QuestionDetailId) 

and P.ControlType = (Select GlobalCodeId from GlobalCodes gbc
inner join GlobalCodeCategories gbcc on gbcc.GlobalCodeCategoryId = gbc.GlobalCodeCategoryId
 where gbc.CodeName = 'Checkbox' and gbcc.CategoryName = 'Control Type' and gbc.IsActive = 1 and gbc.IsDeleted = 0
 and gbcc.IsActive = 1 and gbcc.IsDeleted = 0 limit 1) 
		-- garry code
 and qd.jobid=JobIdParam  -- ;-- and qd.parentdetailid=0);
 and (qo.NextQuestion is not null and qo.NextQuestion > 0)
		-- end garry code
	-- old code
-- and ifnull(qo.NextQuestion,0)<>null
	-- end old code
order by relative_Depth desc, QuestionOptionId asc)
UNION
(Select 0 , 0 )
Limit 1
;

End$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getNextQuestionbackup` (IN `JobIdParam` INT(11), IN `QuestionDetailIdInParam` INT(11))  NO SQL
Begin
Declare TempQuestionDetailId int(11) default -1;
Declare TempQuestionId int(11) default -1; 
Declare TempNextQuestionId int(11) default -1;
Declare TempTemplateId int(11) default -1;
set TempQuestionDetailId = QuestionDetailIdInParam;

select TemplateId into TempTemplateId from QuestionsDetail where JobID = JobIdParam and QuestionDetailId = QuestionDetailIdInParam;

	WITH Recursive Parents AS (
  SELECT 1 AS lvl,QD.QuestionId,Q.Question,QD.OptionId, QD.QuestionDetailId, 0 AS 'relative_depth', Q.NextQuestion, QO.NextQuestion as QONextQuestion, Q.InputType, Q.QuestionType, QO.ControlType
  FROM Questions Q inner join QuestionsDetail QD on Q.QuestionId = QD.QuestionId 
  left join QuestionsOptions QO on QO.QuestionOptionId = QD.OptionId
