CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetRecursiveTree` (IN `ParamQuestionId` INT, IN `ParamType` VARCHAR(1), IN `NewTreeNodeId` INT)  NO SQL
Begin
Declare ChildQuestionId int;
Declare ChildQuestionOptionId int;
SET max_sp_recursion_depth=50;
set ChildQuestionId = -1;
set ChildQuestionOptionId = -1;
if ParamQuestionId = -1 THEN
CREATE TEMPORARY TABLE DecisionTree(
TreeNodeId int not null auto_Increment,		
    TempQuestionId INT ,
TempQuestionOptionId int,
    QType varchar(1),
    NodeTreeParentId int
);

Select QuestionId,'Q' from Questions where StageId= 33 and root = 1;
select max(TreeNodeId) into NewTreeNodeId from DecisionTree;
Select QuestionOptionId, NextQuestionId into ChildQuestionOptionId, ChildQuestionId from QuestionsOptions  where QuestionId = ParamQuestionId;

if ChildQuestionOptionId > -1 and ChildQuestionId> -1 then
values(ChildQuestionId, ChildQuestionOptionId, 'O', NewTreeNodeId);

call sp_GetRecursiveTree (ChildQuestionId, 'O', NewTreeNodeId);
end if;
end if;
end$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_GetTree` (IN `ParamTemplateId` INT(11), IN `ParamJobId` INT(11))  NO SQL
BEGIN

CREATE TEMPORARY TABLE TreeOutput(
    QuestionId INT ,
    Question varchar(200),
    OptionId int,
    QuestionDetailId int,
    relative_depth int,
    NextQuestion int,
    QONextQuestion int,
    InputType int,
    QuestionType int,
    ControlType int,
    Stage int,
    CaseC int,
    ParentDetailId int
);
WITH Recursive Parents AS (
  SELECT Q.QuestionId,Q.Question,QD.OptionId as OptionId,QD.QuestionDetailId, 0 AS 'relative_depth', Q.NextQuestion, QO.NextQuestion as QONextQuestion, Q.InputType, Q.QuestionType, QO.ControlType, Q.Stage,0 as CaseC, QD.ParentDetailId
  FROM Questions Q inner join QuestionsOptions QO on Q.QuestionId = QO.QuestionId
    inner join 
    QuestionsDetail QD on QO.QuestionId = QD.QuestionId and QO.QuestionOptionId = QD.OptionId and QD.JobId = ParamJobId
where Q.TemplateId = ParamTemplateId and Q.IsDeleted=false	
and Q.IsRoot=1  and QO.IsDeleted=false
    
    Union ALL
    
        SELECT Q.QuestionId,Q.Question,QO.QuestionOptionId as OptionId,QD.QuestionDetailId, P.relative_depth+1, Q.NextQuestion, QO.NextQuestion as QONextQuestion, Q.InputType, Q.QuestionType, QO.ControlType, Q.Stage,1, QD.ParentDetailId
  FROM Questions Q 
     inner join Parents P on (P.QONextQuestion = Q.QuestionId or P.NextQuestion = Q.QuestionId)
    inner join QuestionsOptions QO on Q.QuestionId = QO.QuestionId 
    left join 
    QuestionsDetail QD on (QO.QuestionId = QD.QuestionId and QO.QuestionOptionId = QD.OptionId and QD.JobId = ParamJobId)   
where Q.TemplateId = ParamTemplateId and Q.IsDeleted=false	
and Q.IsRoot<>1  and QO.IsDeleted=false
    
    
  Union ALL
    
      SELECT Q.QuestionId,Q.Question,QO.QuestionOptionId as  OptionId,-1 as QuestionDetailId, P.relative_depth+1, Q.NextQuestion, QO.NextQuestion as QONextQuestion, Q.InputType, Q.QuestionType, QO.ControlType, Q.Stage,2, P.ParentDetailId
  FROM Questions Q 
    inner join QuestionsOptions QO on Q.QuestionId = QO.QuestionId and QO.IsDeleted=false
     inner join Parents P on (P.QuestionId = QO.QuestionId  and P.relative_depth=0)    
where Q.TemplateId = ParamTemplateId and Q.IsDeleted=false	
and Q.IsRoot=1 and  not exists (Select QD.QuestionDetailId from QuestionsDetail QD where QD.QuestionId = Q.QuestionId and QD.OptionId = QO.QuestionOptionId) 
       
    
    UNION ALL

  
    SELECT Q.QuestionId,Q.Question,QO.QuestionOptionId as  OptionId,-1 as QuestionDetailId, P.relative_depth+1, Q.NextQuestion, QO.NextQuestion as QONextQuestion, Q.InputType, Q.QuestionType, QO.ControlType, Q.Stage,3, P.ParentDetailId
  FROM Questions Q 
    inner join QuestionsOptions QO on Q.QuestionId = QO.QuestionId and QO.IsDeleted=false
     inner join Parents P on (P.QONextQuestion = Q.QuestionId or P.NextQuestion = Q.QuestionId)    
where Q.TemplateId = ParamTemplateId and Q.IsDeleted=false	
and Q.IsRoot<>1 and not exists (Select QD.QuestionDetailId from QuestionsDetail QD where QO.QuestionId = QD.QuestionId and QO.QuestionOptionId = QD.OptionId and QD.JobId = ParamJobId and QD.ParentDetailId = P.QuestionDetailId)
    
Union ALL
    
        SELECT Q.QuestionId,Q.Question,-2 as OptionId,QD.QuestionDetailId, P.relative_depth+1, Q.NextQuestion, -2  as QONextQuestion, Q.InputType, Q.QuestionType, -2, Q.Stage,4, QD.ParentDetailId
  FROM Questions Q 
     inner join Parents P on (P.QONextQuestion = Q.QuestionId or P.NextQuestion = Q.QuestionId)
    left join 
    QuestionsDetail QD on (Q.QuestionId = QD.QuestionId and (ifnull(QD.OptionId,-1)=-1 or ifnull(QD.OptionId,-1)=0) and QD.JobId = ParamJobId)   
where Q.TemplateId = ParamTemplateId and Q.IsDeleted=false	
and Q.IsRoot<>1 
 and not exists   (Select QO.QuestionId from QuestionsOptions QO where QO.QuestionId = Q.QuestionId and QO.IsDeleted=false )    
    
    
)    
select distinct  QuestionId,Question, OptionId,QuestionDetailId, relative_depth, NextQuestion,QONextQuestion, InputType, QuestionType, ControlType,Stage,CaseC,ParentDetailId from Parents where ((QuestionDetailId <> 0 and CaseC<>4) or (QuestionDetailId>-1 and CaseC=4)) ;

select * from TreeOutput;

select json_Object(
  'QuestionIid',T.QuestionId,'OptionFlag',if(T.OptionId>0,1,0),'Question',T.Question,'Answer',QDP.OptionText    
,'Children',JSON_EXTRACT(IFNULL((select
    CONCAT('[',GROUP_CONCAT( json_array('QuestionId',if(TC.OptionId>0,TC.OptionId,TC.QuestionId),'OptionFlag',if(TC.OptionId>0,1,0),'Question',if(TC.OptionId>0,'ffsfs',TC.Question),'Answer','ddd','Children',JSON_EXTRACT(IFNULL((select
    CONCAT('[',GROUP_CONCAT( json_array('QuestionId',if(TC1.OptionId>0,TC1.OptionId,TC1.QuestionId),'OptionFlag',if(TC1.OptionId>0,1,0),'Question',if(TC1.OptionId>0,'ddd',TC1.Question),'Answer','dddd')
    ),']')
from TreeOutput TC1 where TC1.QuestionId = TC.NextQuestion or TC1.QuestionId = TC.QONextQuestion),'[]'),'$'))
    ),']')
from TreeOutput TC where TC.QuestionId = T.NextQuestion or TC.QuestionId = T.QONextQuestion),'[]'),'$')  
 ) as FinalJson from TreeOutput T 
 left join QuestionsOptions QOP on 
                                 T.OptionId = QOP.QuestionOptionId
                                 left join QuestionsDetail QDP on 
                                 T.QuestionDetailId = QDP.QuestionDetailId
 where relative_depth=0;


END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_UpdatActiveStaus` (IN `tablename` VARCHAR(100), IN `active` BIT, IN `id` INT, IN `modifiedby` VARCHAR(50))  BEGIN
DECLARE result bit DEFAULT 0;
    CASE WHEN
        tablename = 'Segments' THEN
    UPDATE
