    SET
        IsActive = active,
        ModifiedBy = modifiedby,
        ModifiedOn = NOW()
    WHERE
	GlobalCodeId = id;
	WHEN
        tablename = 'Roles' THEN
    UPDATE
        Roles
    SET
        IsActive = active,
        ModifiedBy = modifiedby,
        ModifiedOn = NOW()
    WHERE
       RoleId = id;
	   WHEN
        tablename = 'Users' THEN
    UPDATE
        Users
    SET
        IsActive = active,
        ModifiedBy = modifiedby,
        ModifiedOn = NOW()
    WHERE
       UserId = id;
        WHEN
        tablename = 'Clients' THEN
    UPDATE
        Client
    SET
        IsActive = active,
        ModifiedBy = modifiedby,
        ModifiedOn = NOW()
    WHERE
       ClientId = id;
	    WHEN
        tablename = 'Attributes' THEN
    UPDATE
        Attributes
    SET
        IsActive = active,
        ModifiedBy = modifiedby,
        ModifiedOn = NOW()
    WHERE
       AttributeId = id;
	    WHEN
        tablename = 'Templates' THEN
    UPDATE
        Templates
    SET
        IsActive = active,
        ModifiedBy = modifiedby,
        ModifiedOn = NOW()
    WHERE
       TemplateId = id;
	   WHEN
        tablename = 'Inventorys' THEN
    UPDATE
        Inventorys
    SET
        IsActive = active,
        ModifiedBy = modifiedby,
        ModifiedOn = NOW()
    WHERE
       StockId = id;
	      WHEN
	    tablename = 'Permissions' THEN
    UPDATE
        Permissions
    SET
        IsActive = active,
        ModifiedBy = modifiedby,
        ModifiedOn = NOW()
    WHERE
       StockId = id;
        
        END CASE;
		IF (Select ROW_COUNT() > 0)
        THEN
           set result = 1;
        END IF;
		Select result as result;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_UpdateWidget` (IN `widgetcode` VARCHAR(50), IN `userid` INT, IN `updatedby` VARCHAR(50))  BEGIN
		DECLARE result bit DEFAULT 0;
		DECLARE userwidgetId int;

		set userwidgetId=(Select UserWidgetMappingId from UserWidgetMappings uwm
		Inner Join Widgets w on w.WidgetId=uwm.WidgetId
		Where w.WidgetCode=widgetcode and uwm.Userid=userid);
    UPDATE
        UserWidgetMappings
    SET
        IsDeleted = 0,
        ModifiedBy = updatedby,
        ModifiedOn = NOW()
    WHERE
        UserWidgetMappingId = userwidgetId;	
		
			IF (Select ROW_COUNT() > 0)
			THEN
			   set result = 1;
			END IF;
	   Select result as result;
	END$$

