CREATE DEFINER=`root`@`localhost` FUNCTION `fn_getJson` (`QuestionIdParam` INT(11), `QuestionOptionIdParam` INT(11)) RETURNS LONGTEXT CHARSET latin1 READS SQL DATA
    DETERMINISTIC
Begin
Declare OptionsCount int DEFAULT -1;
if QuestionIdParam> 0 then    
    Select count(QuestionOptionId) into OptionsCount from QuestionsOptions where QuestionId = QuestionIdParam;
    
    if OptionsCount>0 then
            return JSON_EXTRACT(IFNULL((select
                CONCAT('[',GROUP_CONCAT( json_object('QuestionId',QO.QuestionOptionId,'OptionFlag',1,'Question',QO.OptionText,'Answer','Test','Children','ss')
                ),']')
            from QuestionsOptions QO where QO.QuestionId = QuestionIdParam),'[]'),'$');
    ELSE
            Select NextQuestion into QuestionIdParam from Questions where ifnull(NextQuestion,0)>0 and QuestionId = QuestionIdParam;
            if QuestionIdParam>0 then
                	return fn_getJson(QuestionIdParam,-1);
            ELSE
                	return JSON_EXTRACT('[]','$');
        	End if;
  	End if;
elseif QuestionOptionIdParam>0 then


return JSON_EXTRACT(IFNULL((select
    CONCAT('[',GROUP_CONCAT( json_object('QuestionId',Q.QuestionId,'OptionFlag',0,'Question',Q.Question,'Answer','Test','Children',fn_getJson(Q.QuestionId,-1))
    ),']')
from Questions Q inner join QuestionsOptions QO on Q.QuestionId=QO.NextQuestion where QO.QuestionOptionId  = QuestionOptionIdParam),'[]'),'$');
End if;

End$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fn_getTreeJson` (`QuestionId` INT(11), `QuestionOptionId` INT(11)) RETURNS LONGTEXT CHARSET utf8mb4 COLLATE utf8mb4_bin READS SQL DATA
    SQL SECURITY INVOKER
return JSON_EXTRACT(IFNULL((select
    CONCAT('[',GROUP_CONCAT( json_array('QuestionId',if(TC.OptionId>0,TC.OptionId,TC.QuestionId),'OptionFlag',if(TC.OptionId>0,1,0),'Question',if(TC.OptionId>0,QO.OptionText,TC.Question),'Answer',QD.OptionText)
    ),']')
from TreeOutput TC inner join QuestionsOptions QO on 
                                 TC.OptionId = QO.QuestionOptionId
                                 left join QuestionsDetail QD on 
                                 TC.QuestionDetailId = QD.QuestionDetailId where TC.QuestionId = QuestionId 
                                 ),'[]'),'$')$$

DELIMITER ;

